import React, { Component } from 'react';
import {Link} from "react-router-dom";
import Movies from './Movies';
import { movies } from './GetMovies';


export default class Navbar extends Component {
  render() {

    return (
      <div style={{display:"flex",padding:"1rem",color:"#3742fa"}}>
     
      <Link key={movies.results[0]} to= "/" style={{textDecoration:"none"}}><h1 style={{marginLeft:"2rem",marginTop:"0.2rem"}}>MoviesApp</h1></Link>
     
     <Link key={movies.results[1]} to= "/favourites" style={{textDecoration:"none"}}> <h2 style={{marginLeft:"2rem",marginTop:"0.8rem"}}>Favourites</h2></Link>  
   </div>
    )
  }
}
